    data: |
      SELECT DISTINCT - 59 * + col0 + - ( 92 ) AS col0, col0 * - 71 AS col2 FROM tab2 (FORMAT parquet) AS cor0;
  - name: tab2

outputs:
  - name: q5641.out
    data: |
      -2806	-3266
      -3868	-4544
      -4517	-5325
